import React, { useEffect, useRef } from 'react';
import { gsap } from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';
import ScienceOutlinedIcon from '@mui/icons-material/ScienceOutlined';

gsap.registerPlugin(ScrollTrigger);

function MySkills() {
  const headingRef = useRef();
  const iconRef = useRef();
  const skillRefs = useRef([]);

  useEffect(() => {
    gsap.fromTo(headingRef.current,
      { x: '-100%', opacity: 0 },
      {
        x: '0%',
        opacity: 1,
        duration: 1,
        ease: 'power3.out',
        scrollTrigger: {
          trigger: headingRef.current,
          start: 'top 80%',
          end: 'bottom 20%',
          toggleActions: 'play none none none'
        }
      }
    );

    gsap.fromTo(iconRef.current,
      { x: '100%', opacity: 0 },
      {
        x: '0%',
        opacity: 1,
        duration: 1,
        ease: 'power3.out',
        scrollTrigger: {
          trigger: iconRef.current,
          start: 'top 80%',
          end: 'bottom 20%',
          toggleActions: 'play none none none'
        }
      }
    );

    skillRefs.current.forEach((ref) => {
      if (ref) {
        gsap.fromTo(ref,
          { y: '100%', opacity: 0 },
          {
            y: '0%',
            opacity: 1,
            duration: 1,
            ease: 'power3.out',
            scrollTrigger: {
              trigger: ref,
              start: 'top 80%',
              end: 'bottom 20%',
              toggleActions: 'play none none none'
            }
          }
        );
      }
    });
  }, []);

  return (
    <div className='bg-gray-950 flex flex-col min-h-screen p-4'>
      <div className='flex justify-between items-center mt-8'>
        <p ref={headingRef} className='text-5xl font-serif font-bold text-white'>My Skills</p>
        <ScienceOutlinedIcon ref={iconRef} className='text-white' />
      </div>
      <hr className='border-t-1 border border-yellow-500 w-full my-4' />
      <div className='mt-10'>
                <p className='text-4xl font-serif font-bold text-yellow-500 mb-6 '>Technologies I Use</p>
                <div className='grid grid-cols-3 md:grid-cols-5  gap-4'>
                    {[
                        { name: 'HTML', logo: 'data:image/png;base64,' },
                        { name: 'CSS', logo: 'data:image/jpeg;base64,' },
                        { name: 'JavaScript', logo: 'data:image/jpeg;base64,' },
                        { name: 'React', logo: 'data:image/png;base64,' },
                        { name: 'Material UI', logo: 'data:image/png;base64,' },
                        { name: 'Redux-Toolkit', logo: 'data:image/jpeg;base64,' },
                        { name: 'JQuery', logo: 'data:image/png;base64,' },
                        { name: 'Tailwind CSS', logo: 'data:image/png;base64,' },
                        { name: 'Bootstrap', logo: 'data:image/jpeg;base64,' },
                        { name: 'GSAP Animation', logo: 'data:image/png;base64,' },
                        { name: 'GitHub', logo: 'data:image/jpeg;base64,' },
                        { name: 'Firebase', logo: 'data:image/jpeg;base64,' },
                        
                        // Add more logos as needed
                    ].map((tech, index) => (
                        <div key={index} className='flex flex-col items-center bg-white shadow-md shadow-blue-400 rounded-lg p-6'>
                            <img src={tech.logo} alt={`${tech.name} logo`} className='w-20 h-20 mb-4' />
                            <p className='text-lg font-serif text-gray-800'>{tech.name}</p>
                        </div>
                    ))}
                </div>
            </div>
    </div>
  );
}

export default MySkills;
